DROP TABLE IF EXISTS `zac_sub_account_detail`;
CREATE TABLE `zac_sub_account_detail` (
  `id` bigint(20) unsigned NOT NULL COMMENT '唯一标识',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `account_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '主账户id',
  `sub_account_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '子账户id',
  `sn` varchar(32) NOT NULL DEFAULT '' COMMENT '明细编号',
  `trade_sn` varchar(32) NOT NULL DEFAULT '' COMMENT '交易系统-订单编号',
  `trade_source` tinyint(4) NOT NULL DEFAULT '1' COMMENT '交易来源,code=SUB_ACCOUNT_DETAIL_TRADE_SOURCE',
  `sign` tinyint(4) NOT NULL DEFAULT '1' COMMENT '运算符号,code=COMM_OPERATOR_SYMBOL',
  `original_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '原金额',
  `amount_paid` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '交易金额',
  `changed_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '变更后金额',
  `payment_date` datetime DEFAULT NULL COMMENT '支付成功日期',
  `type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '子账户明细类型,code=SUB_ACCOUNT_DETAIL_TYPE',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '子账户明细状态,code=SUB_ACCOUNT_DETAIL_STATUS',
  `remark` varchar(512) NOT NULL DEFAULT '' COMMENT '备注信息',
  `operator` varchar(512) NOT NULL DEFAULT '' COMMENT '操作人',
  `operator_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '操作人类型,code=SUB_ACCOUNT_DETAIL_OPERATOR_TYPE',
  `operator_phone` varchar(32) NOT NULL DEFAULT '' COMMENT '操作人手机号',
  `rela_detail_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '关联账单id',
  `version` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '更新版本号',
  `creator_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '创建人',
  `modifier_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '修改人',
  `record_status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态(0无效1有效)',
  PRIMARY KEY (`id`),
  KEY `fk_zac_sub_account_detail_sn` (`sn`) USING BTREE,
  KEY `fk_zac_sub_account_detail_trade_sn` (`trade_sn`) USING BTREE,
  KEY `fk_zac_sub_account_detail_sub_account_id` (`sub_account_id`) USING BTREE,
  KEY `fk_zac_sub_account_detail_account_id` (`account_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='账户中心-子账户明细表';

